import React, { useEffect, useState } from 'react';
import { ITableProps } from '../types/types';
import { MapUtils } from '../utils/MapUtils';
import { proxyUrls } from '../utils/MapConfig';

const Table = (props: ITableProps) => {

    const [table, setTable] = useState<string[]>([])
    const [count, setCount] = useState<string[]>([])

    function createTablefromGeoJson() {
        let result: string[] = [];
        let number:string[] = [];
        MapUtils.getGeojson(proxyUrls[1])
            .then(data => data)
            .then(featureCollection => featureCollection.jsonb_build_object)
            .then(features => {
                console.log(features.features)
                for (let i = 0; i < features.features.length; i++) {
                    result.push(features.features[i].properties.stt_name)
                    count.push(features.features[i].properties.count)
                 }
            })
            .then(() => {
                setTable(result)
                setCount(count)
            })
    }


    useEffect(() => {
        createTablefromGeoJson()
    }, []);

    return (
        <>

            <ul>
                {table.map((item, key) => <li key={key}>{item} | {count.map((item, key) => item)}</li>)}
                {count.map((item, key) => <p key={key}>{item}</p>)}
            </ul>


        </>
    )
}

export default Table;
